import React from "react";

export default function ToDoList() {
  const [listPoints, setlistPoints] = React.useState([
    {
        text: "vasketid",
        isCompleted: true,
        id: 1
        
    },
    {
        text: "indkøb",
        isCompleted: false, 
        id: 2
    }
]  );
  const [inputText, setInputText] = React.useState('');

  const addListItem = (textOfListItem)=>{
    const newList = [
        ...listPoints, 
        {
            text:textOfListItem,
            isCompleted: false,
            id: Math.floor(Math.random() * 1000)
        }

    ]    
    setlistPoints(newList)
  }


  return (
      <>
    <ul>
      {listPoints.map(listPoint => (
        

        (listPoint.isCompleted ? <li> <strike>{listPoint.text}</strike></li> : <li>{listPoint.text}</li>)


      ))}
    </ul>
    <input type="text" value={inputText} onChange={(event)=>setInputText(event.target.value)}/>
    <button onClick={()=>{addListItem(inputText); setInputText('')}}>Click me</button>
    </>
  );
}
